const Hero = () => {
  return (
    <div
      style={{
        width: "100vw",
        height: "100vh",
        
        backgroundSize: "cover",
        backgroundPosition: "center",
      }}
    >
      <h1>Welcome to Our Website</h1>
      <p>Your journey begins here.</p>
    </div>
  );
};

export default Hero;
